INSERT INTO `histories` VALUES (1,'Test History by latheef','2','2014-02-19 09:10:07',3),(2,'test','0','2014-02-01 13:13:07',7),(3,'test comamnd','0','2014-02-01 13:13:18',7),(4,'test comamnd','0','2014-02-01 13:14:12',7),(5,'test comamnd 2','0','2014-02-01 13:14:23',7),(6,'test comamnd 2','2','2014-02-01 13:15:52',7),(7,'This  server decommissioned beore','2','2014-02-01 13:16:08',7),(8,'Command','2','2014-02-01 13:18:32',7),(9,'Command','2','2014-02-01 13:27:08',7),(10,'AFter changing array and reading from session','2','2014-02-01 13:37:56',7),(11,'test','2','2014-02-01 14:18:47',2),(12,'test','Abdul Latheef','2014-02-01 14:20:00',2),(13,'Oracle Ticket has bee logged for this server due to CPU failure.','Abdul Latheef','2014-02-01 14:28:30',2),(14,'Solaris is a Unix operating system originally developed by Sun Microsystems. It superseded their earlier SunOS in 1993. Oracle Solaris, as it is now known, has been owned by Oracle Corporation since Oracle\'s acquisition of Sun in January 2010.[2]\nSolaris is known for its scalability, especially on SPARC systems, and for originating many innovative features such as DTrace, ZFS and Time Slider.[3][4] Solaris supports SPARC-based and x86-based workstations and servers from Oracle and other vendors, with efforts underway to port to additional platforms. Solaris is registered as compliant with the Single Unix Specification.\nSolaris was historically developed as proprietary software. Subsequently, in June 2005, Sun Microsystems released most of the codebase under the CDDL license, and founded the OpenSolaris open source project.[5] With OpenSolaris, Sun wanted to build a developer and user community around the software. After the acquisition of Sun Microsystems in January 2010, Oracle decided to discontinue the OpenSolaris distribution and the development model.[6][7] Just ten days before the internal Oracle memo announcing this decision to employees was \"leaked\", Garrett D\'Amore had announced[8] the illumos project, creating a fork of the Solaris kernel and launching what has since become a thriving alternative to Oracle Solaris.','Abdul Latheef','2014-02-01 17:52:49',2),(15,'This is a test command on this system','Abdul Latheef','2014-02-01 20:22:25',5),(16,'This is my second comment','Abdul Latheef','2014-02-01 20:26:23',5),(17,'Test one more comment','Abdul Latheef','2014-02-01 20:28:00',5),(18,'to clean the textbox after submitting','Abdul Latheef','2014-02-01 20:30:00',5),(19,'Testing the message for post','Abdul Latheef','2014-02-02 00:08:03',5),(20,'Test to update ','Abdul Latheef','2014-02-02 00:36:50',5),(21,'test','Abdul Latheef','2014-02-02 00:37:55',5),(22,'test','Abdul Latheef','2014-02-02 00:38:23',5),(23,'tst','Abdul Latheef','2014-02-02 00:42:23',5),(24,'new test','Abdul Latheef','2014-02-02 00:42:53',5),(25,'test to check log error alert','Abdul Latheef','2014-02-02 00:45:18',5),(26,'test to check online update','Abdul Latheef','2014-02-02 00:45:57',5),(27,'First test','Abdul Latheef','2014-02-02 00:47:15',5),(28,'test after editing log to logs','Abdul Latheef','2014-02-02 00:47:45',5),(29,'There was an issue wiht system controller','Abdul Latheef','2014-02-02 00:48:03',5),(30,'System was rebooted multiple times','Abdul Latheef','2014-02-02 00:48:16',5),(31,'Test by latheefp','Abdul Latheef','2014-02-02 07:45:31',2),(32,'Test comment','Abdul Latheef','2014-02-02 18:48:21',9),(33,'test first command','Abdul Latheef','2014-02-02 18:50:59',11);
