DROP TABLE IF EXISTS `old-servers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `old-servers` (
  `ServerID` int(11) NOT NULL AUTO_INCREMENT,
  `ServerIP` varchar(16) DEFAULT NULL,
  `ServerUserName` varchar(15) NOT NULL DEFAULT 'root',
  `ServerConnection` enum('SSH') NOT NULL DEFAULT 'SSH',
  `SerialNumber` varchar(50) DEFAULT NULL,
  `ServerHostName` varchar(255) DEFAULT NULL,
  `ServerApplication` text,
  `ApplicationOwner` text,
  `ApplicationOwner2` varchar(255) DEFAULT NULL,
  `OwnerTeam` varchar(255) DEFAULT NULL,
  `OwnerTeamEMail` text,
  `ServerSupportLevel` enum('Production','Development','PreProduction','To be Production','DR','Testing','Free','PoweredOff','Unknown','Workstation','Assigned') NOT NULL DEFAULT 'Unknown',
  `OSType` varchar(60) DEFAULT NULL,
  `OSVersion` varchar(60) DEFAULT NULL,
  `RackNo` varchar(10) DEFAULT NULL,
  `Location` enum('Tawaren','Dana','Suly','Jeddah','Jeddah-Economy Tower','Jeddah-Bin Hamran','Khobar-AlRasheed','AlSalam','Kingdom Tower','Jeddah-Noujud Center','Malga','Bayanat') DEFAULT NULL,
  `ControllerID` int(10) unsigned DEFAULT NULL,
  `ServerHWType` varchar(40) DEFAULT NULL,
  `OSVMType` set('GlobalZone','Zone','PrimaryLDomain','LDomain','VIOC','wpar') DEFAULT NULL,
  `VMOSParent` int(10) unsigned DEFAULT NULL,
  `ServerCPU` varchar(40) DEFAULT NULL,
  `ServerMemory` varchar(40) DEFAULT NULL,
  `ServerDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `ServerAccess` enum('Yes','No') NOT NULL DEFAULT 'No',
  `ClusterInfo` text,
  `ClusterType` enum('SUN','Veritas','HACMP') DEFAULT NULL,
  `TAMinstalled` enum('Yes','No') DEFAULT NULL,
  `PatrolRunning` enum('Yes','No') DEFAULT NULL,
  `NetworkIPs` text,
  `ConsoleIP` varchar(40) DEFAULT NULL,
  `psApps` text,
  `Notes` text,
  `GroupSet` set('UnixServer','WindowsServer','Unknown') NOT NULL DEFAULT 'Unknown',
  `TSM` enum('Yes','No') DEFAULT NULL,
  `NetworkMAC` text,
  `WWNPORTs` text,
  `HWLevel` enum('Mid-Range','High-End','Entry-class','other') DEFAULT NULL,
  `hostid` varchar(50) DEFAULT NULL,
  `SysAdmin` varchar(70) DEFAULT NULL,
  `AgentVersion` varchar(5) DEFAULT NULL,
  `LastVisit` timestamp NULL DEFAULT NULL,
  `Readyforservice` varchar(255) DEFAULT NULL,
  `Cost` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ServerID`),
  UNIQUE KEY `ServerIP` (`ServerIP`),
  UNIQUE KEY `ServerHostName` (`ServerHostName`),
  KEY `ControllerID` (`SerialNumber`),
  KEY `SysAdmin` (`SysAdmin`)
) ENGINE=MyISAM AUTO_INCREMENT=869 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

